import React, { Component } from 'react'

export default class App extends Component {
  constructor(props){
    super(props)
    this.state={
      count: 0
    }
  }
  componentDidMount(){
    console.log("cdm called")
  }
  componentDidUpdate(){
    console.log("cdu called")
  }
  update=()=>{
    this.setState({
      count : this.state.count + 1
    })
  }
  render() {
    return (
      <div>
        {this.state.count}
        <button onClick={this.update}>Update</button>
      </div>
    )
  }
}
